import React from 'react';
import MandalArtTable from './MandalArtTable';

const MandalArtTemplate = (MandalArtTable) => {
    return (
        <main>
            <title>만다라트</title>

            <div>
                {MandalArtTable}
            </div>
        </main>
    );
};

export default MandalArtTemplate;
